import React, { Component } from 'react';
import Button from '@material-ui/core/Button';
import HeaderCitoyen from './HeaderCitoyen';
import history from './history';

import { makeStyles } from '@material-ui/core/styles';
import Table from '@material-ui/core/Table';
import TableBody from '@material-ui/core/TableBody';
import TableCell from '@material-ui/core/TableCell';
import TableContainer from '@material-ui/core/TableContainer';
import TableHead from '@material-ui/core/TableHead';
import TableRow from '@material-ui/core/TableRow';
import Paper from '@material-ui/core/Paper';


class ConsulterDemarche extends Component {



    constructor(props) {
        super(props);
        this.state = {demarche: null, typeDemarche: ""};

    }

    componentDidMount() {
        const type = this.props.location.state.typeDemarche;
        const id = this.props.location.state.idDemarche;
        const url = "http://localhost:8080/Web-Project/project/GetDemandeById/"+id;
        fetch(url)
        .then(res => res.json())
        .then(
        (data) => {
          this.setState({demarche: data});
        },
        // Remarque : il est important de traiter les erreurs ici
        // au lieu d'utiliser un bloc catch(), pour ne pas passer à la trappe
        // des exceptions provenant de réels bugs du composant.
        (error) => {

        }
        )
        if (type == "carte") {
            this.setState({typeDemarche: "carte"});
        } else if (type == "passeport") {
            this.setState({typeDemarche: "passeport"});

        } else {
            this.setState({typeDemarche: "immatriculation"});
        }
    }



    render() {

        var element = null;


        if (this.state.typeDemarche == "carte") {
            element = <table className="customers">
            <tr>
              <th>Company</th>
              <th>Contact</th>
